package test.hcesdk.mpay.payment.delegatedauth;public abstract class DelegatedAuthCallback {    /**     * Called when an unrecoverable error has been encountered and the operation is complete.     * No further callbacks will be made on this object.     * @param errorCode An integer identifying the error message     * @param errString A human-readable error string that can be shown in UI     */    public void onAuthenticationError(int errorCode, CharSequence errString) { }    /**     * Called when a recoverable error has been encountered during authentication. The help     * string is provided to give the user guidance for what went wrong, such as     * "Sensor dirty, please clean it."     * @param helpCode An integer identifying the error message     * @param helpString A human-readable string that can be shown in UI     */    public void onAuthenticationHelp(int helpCode, CharSequence helpString) { }    /**     * Called when a fingerprint is recognized.     */    public void onAuthenticationSucceeded() { }    /**     * Called when a fingerprint is valid but not recognized.     */    public void onAuthenticationFailed() { }}